import React from "react";
import Sdata from "./Sdata";
import Netflixcard from "./Netflixcard";
 function ncard(val)
    {
        return(
                   <>
 <Netflixcard
        imgsrc={val[0].imgsrc}
        title={val[0].title}
        sname={val[0].sname}
        link={val[0].link}
    />
    </>
        )
    }
function Cards()
{
   
    return (
 <>
{Sdata.map(ncard)}
 </>  
    )
}
export default Cards;
